import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import RoleSelection from './components/RoleSelection';
import UploadForm from './components/JobSeeker/UploadForm';
import RecruiterForm from './components/Recruiter/RecruiterForm';
import AuthForm from './components/AuthForm'; // ✅ Step 4 me banayi file

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/auth" element={<AuthForm />} /> {/* ✅ New Route */}
        <Route path="/" element={<RoleSelection />} />
        <Route path="/jobseeker" element={<UploadForm />} />
        <Route path="/recruiter" element={<RecruiterForm />} />
      </Routes>
    </Router>
  );
};

export default App;
